import React from "react";
import "../styles/styles.css";

const List = () => {
  const array = [
    "I do not fear computers. I fear lack of them.",
    "Read that article ",
    "Must remember stupid chore",
    "Remember to do the deed",
    "One should always do the task",
  ];
  return (
    <ul className="list">
      {array.map((item) => (
        <li>{item}</li>
      ))}
    </ul>
  );
};

export default List;
